A Sequence Consensus abstraction, in Kompics terms, is a composite component that **provides** the following port *(already imported in the notebook)*.

    class SequenceConsensus extends Port {
        request[SC_Propose];
        indication[SC_Decide];
    }

In your implementation, the **Sequence Consensus** component should indicate with a `SC_Decide` message every value that is appended in the decided sequence (invoked in FIFO order) as well as requesting proposed values through a `SC_Propose` message:

    case class SC_Propose(value: RSM_Command) extends KompicsEvent;
    case class SC_Decide(value: RSM_Command) extends KompicsEvent;

    trait RSM_Command



Your sequence consensus component builds on top of a `Ballot Leader Election` component (simulated, no need to provide an implementation). That means that it subscribes to `BLE_Leader(Leader, Ballot)` indications whenever a new leader is elected alongside a maximum ballot. 

Furthermore, a `FIFOPerfectLink` abstraction is also provided to send and receive messages in FIFO order between every two processes, using the same messages as the PerfectLink port introduced in Part I (i.e., using `PL_Send(destination, payload)` and `PL_Receive(sender, payload)` messages)  

The following properties define the expected behavior of a consensus abstraction more specifically:

1. **Validity**: *Every value decided in a sequence has been previously proposed*
2. **Uniform Agreement**: *For every two sequences decided across different processs, one is a prefix of the other.*
3. **Completeness**: *Every command proposed by a correct process is eventually included in a decided sequence by every correct process.*

The recommended algorithm to use is the the one we call "Leader-Based Sequence Paxos" which extends and optimises single value paxos to work with sequences of values.
You can find the algorithm in the following  <a href="https://courses.edx.org/asset-v1:KTHx+ID2203.2x+2016T4+type@asset+block@sequence-paxos.pdf" target="_blank">document</a>.

//Provided Primitives to use in your implementation

case class Prepare(nL: Long, ld: Int, na: Long) extends KompicsEvent;
case class Promise(nL: Long, na: Long, suffix: List[RSM_Command], ld: Int) extends KompicsEvent;
case class AcceptSync(nL: Long, suffix: List[RSM_Command], ld: Int) extends KompicsEvent;
case class Accept(nL: Long, c: RSM_Command) extends KompicsEvent;
case class Accepted(nL: Long, m: Int) extends KompicsEvent;
case class Decide(ld: Int, nL: Long) extends KompicsEvent;

object State extends Enumeration {
    type State = Value;
    val PREPARE, ACCEPT, UNKOWN = Value;
}

object Role extends Enumeration {
    type Role = Value;
    val LEADER, FOLLOWER = Value;
}

def suffix(s: List[RSM_Command], l: Int): List[RSM_Command] = {
    s.drop(l)
}

def prefix(s: List[RSM_Command], l: Int): List[RSM_Command] = {
    s.take(l)
}

class SequencePaxos(init: Init[SequencePaxos]) extends ComponentDefinition {

import Role._
import State._

  val sc = provides[SequenceConsensus];
  val ble = requires[BallotLeaderElection];
  val pl = requires[FIFOPerfectLink];

  val (self, pi, others) = init match {
    case Init(addr: Address, pi: Set[Address] @unchecked) => (addr, pi, pi - addr)
  }
  val majority = (pi.size / 2) + 1;

  var state = (FOLLOWER, UNKOWN);
  var nL = 0l;
  var nProm = 0l;
  var leader: Option[Address] = None;
  var na = 0l;
  var va = List.empty[RSM_Command];
  var ld = 0;
  // leader state
  var propCmds = List.empty[RSM_Command];
  val las = mutable.Map.empty[Address, Int];
  val lds = mutable.Map.empty[Address, Int];
  var lc = 0;
  val acks = mutable.Map.empty[Address, (Long, List[RSM_Command])];

  def max(ack : mutable.Map[Address, (Long, List[RSM_Command])]) : List[RSM_Command] = { 
      var maxn : Long = 0;
      var longestSfx = List.empty[RSM_Command];
      for ((_, (n, sfx)) <- ack) {
          if (n > maxn) {
              maxn = n;
              longestSfx = sfx;
          }
          else if (n == maxn && sfx.size > longestSfx.size) {
              maxn = n;
              longestSfx = sfx;
          }
      }
      longestSfx;
  }


  ble uponEvent {

    // upon event <ble, Leader | L, n>
    case BLE_Leader(l, n) => {
        if (n > nL){
            leader = Some(l);
            nL = n;
            if (self == l && nL > nProm){
                // state := (LEADER, PREPARE)
                state = (LEADER, PREPARE);
                propCmds = List.empty[RSM_Command];
                for(p <- pi){
                    las += ((p, 0));
                }
                //las.clear();
                lds.clear();
                acks.clear();
                lc = 0;
                // for all p ∈ Π \ {self } do
                for (p <- others){
                    // trigger <fifop2p, Send | p, [PREPARE, nL, ld, na]>
                    // Prepare(nL: Long, ld: Int, na: Long)
                    trigger(PL_Send(p, Prepare(nL, ld, na)) -> pl);
                }
                acks += ((l, (na, suffix(va, ld))));
                lds += ((self, ld));
                nProm = nL;
            }
            else{
                state = (FOLLOWER, state._2)
            }
        }
    }
   }

  pl uponEvent {

    // upon event <fifo2p,Deliver | p, [PREPARE, np, ld, n]>
    case PL_Deliver(p, Prepare(np, ldp, n)) => {
        if (nProm < np){
            nProm = np;
            state = (FOLLOWER, PREPARE);
            var sfx = List.empty[RSM_Command];
            if (na >= n){
                sfx = suffix(va, ldp);
            }
            else{
                sfx = List.empty[RSM_Command];
            }
            // trigger <fifop2p, Send | p, [PROMISE, np, na, sfx, ld]>
            // Promise(nL: Long, na: Long, suffix: List[RSM_Command], ld: Int)
            trigger(PL_Send(p, Promise(np, na, sfx, ldp)) -> pl);
        }
    }

    // upon event ⟨fifop2p, Deliver | a, [Promise, n, na, sfxa, lda]⟩ do
    case PL_Deliver(a, Promise(n, na, sfxa, lda)) => {
      if ((n == nL) && (state == (LEADER, PREPARE))) {
          acks += ((a, (na, sfxa)));
          lds += ((a, lda));
          // P := { p∈Π | acks[p]  ̸= ⊥}
          if (acks.size == majority){
              var sfx = max(acks);
              va = prefix(va, ld) ++ sfx ++ propCmds;
              las(self) = va.size;
              propCmds = List.empty[RSM_Command];
              state = (LEADER, ACCEPT);
              for((p, v) <- lds){
                  if (p != self){
                      val sfxp = suffix(va, v);
                      // AcceptSync(nL: Long, suffix: List[RSM_Command], ld: Int
                      trigger(PL_Send(p, AcceptSync(nL, sfxp, v)) -> pl);
                  }
              }
          }
      } else if ((n == nL) && (state == (LEADER, ACCEPT))) {
          lds += ((a, lda));
          val sfx = suffix(va, lds(a));
          trigger(PL_Send(a, AcceptSync(nL, sfx, lds(a))) -> pl);
          if (lc != 0) {
              trigger(PL_Send(a, Decide(ld, nL)) -> pl);
          }
      }
    }

    // upon event ⟨ fifop2p, Deliver | p, [AcceptSync, nL, sfxv, ld]⟩ do
    case PL_Deliver(p, AcceptSync(nL, sfx, ldp)) => {
      if ((nProm == nL) && (state == (FOLLOWER, PREPARE))) {
          na = nL;
          va = prefix(va, ld) ++ sfx;
          trigger(PL_Send(p, Accepted(nL, va.size)) -> pl);
          state = (FOLLOWER, ACCEPT);
      }
    }

    // upon event ⟨ fifop2p, Deliver | p, [Accept, nL, C] ⟩ do
    case PL_Deliver(p, Accept(nL, c)) => {
      if ((nProm == nL) && (state == (FOLLOWER, ACCEPT))) {
          va :+= c;
          trigger(PL_Send(p, Accepted(nL, va.size)) -> pl);
      }
    }

    // upon event ⟨ fifop2p, Deliver | p, [Decide, l, nL] ⟩ do
    case PL_Deliver(_, Decide(l, nL)) => {
       if (nProm == nL) { 
           while(ld < l) { 
               trigger(SC_Decide(va(ld)) -> sc);
               ld += 1;
           }
       }
    }

    // upon event ⟨ fifop2p, Deliver | a, [Accepted, n, m] ⟩ do
    case PL_Deliver(a, Accepted(n, m)) => {
      if ((n == nL) && (state == (LEADER, ACCEPT))) {
          las(a) = m;
          if (lc < m && pi.filter(p => las(p) >= m).size >= majority) { 
              lc = m;
              for ((p, _) <- lds) {
                  trigger(PL_Send(p, Decide(lc, nL)) -> pl);
              }
         }
      }
    }
  }

  // upon event ⟨ sc, Propose | C ⟩ do
  sc uponEvent {
    case SC_Propose(c) => {
      if (state == (LEADER, PREPARE)) {
          propCmds :+= c;
      } 
      else if (state == (LEADER, ACCEPT)) {
          va :+= c;
          las(self) += 1;
          for ((p, _) <- lds) {
              if (p != self) {
                  trigger(PL_Send(p, Accept(nL, c)) -> pl);
              }
         }
      }
    }
  }
}
